CREATE TABLE `manage_exception` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `exception` text COMMENT '异常类型名称',
  `content` text NOT NULL COMMENT '异常内容',
  `createTime` datetime NOT NULL COMMENT '异常日期',
  `remark` text COMMENT '处理备注',
