#
# Structure for table "manage_user_op_log"
#

CREATE TABLE `manage_user_op_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '用户ID',
  `user_name` varchar(500) NOT NULL COMMENT '用户名称',
  `user_type` int(1) NOT NULL COMMENT '用户类型1前台用户2后台用户',
  `content` varchar(10000) DEFAULT NULL COMMENT '内容',
  `create_time` datetime NOT NULL COMMENT '日期',
  `requestPath` varchar(500) DEFAULT NULL COMMENT '请求路径',
  `content_en` varchar(10000) DEFAULT NULL COMMENT '英文内容',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1873 DEFAULT CHARSET=utf8 COMMENT='操作日志';

