#
# Structure for table "tx_applay"
#

CREATE TABLE `tx_applay` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `userId` int(11) DEFAULT NULL COMMENT '申请人id',
  `name` varchar(50) DEFAULT NULL COMMENT '申请人姓名',
  `fee` bigint(20) DEFAULT '0' COMMENT '申请金额',
  `createTime` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '申请时间',
  `state` int(11) DEFAULT '0' COMMENT '申请状态 0 未审核 1 已审核',
  `batch` varchar(255) DEFAULT NULL COMMENT '申请批次',
  `checkTime` datetime DEFAULT NULL COMMENT '审核时间',
  `orderCode` varchar(255) DEFAULT NULL COMMENT '提现订单号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='提现申请表';

