#
# Structure for table "tx_banner"
#

CREATE TABLE `tx_banner` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `imgUrl` varchar(500) DEFAULT NULL COMMENT '图片地址',
  `state` int(11) DEFAULT '1' COMMENT '状态 0 不可用 1 可用',
  `targetUrl` varchar(500) DEFAULT NULL COMMENT '跳转地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='轮播图';

