#
# Structure for table "tx_business_type"
#

CREATE TABLE `tx_business_type` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `billType` varchar(255) DEFAULT NULL COMMENT '费用类型 001水费，002电费',
  `feeTypeDesc` varchar(255) DEFAULT NULL COMMENT '对应费用类型的中文描述如电费',
  `billArea` varchar(255) DEFAULT NULL COMMENT '缴费地区例如:大庆市等等',
  `chargeUnit` varchar(255) DEFAULT NULL COMMENT '收费单位最终的收费单位，如“大庆市电力局',
  `isNeedDate` int(11) DEFAULT '0' COMMENT '是否需要上送账期 0 ：不需要  1：需要',
  `isNeedFee` int(11) DEFAULT '0' COMMENT '是否需要预',
  `cityCode` varchar(255) DEFAULT NULL COMMENT '城市码',
  `serviceType` varchar(255) DEFAULT NULL COMMENT '缴费项目编号',
  `addInfo` text COMMENT '附加信息',
  `bigLetters` varchar(255) DEFAULT NULL COMMENT '城市首字母（大写）',
  `state` int(11) DEFAULT '0' COMMENT '状态 0 禁用，1 可用',
  `remark1` varchar(255) DEFAULT NULL COMMENT '对应城市表cityCode',
  `remark2` varchar(255) DEFAULT NULL COMMENT '备用',
  `remark3` varchar(255) DEFAULT NULL COMMENT '备用',
  `feeRule` varchar(255) DEFAULT NULL COMMENT '预存金额输,空：没有限制，可输入任',
  `isNeedPolt` int(11) DEFAULT '0' COMMENT '是否需要小',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=281 DEFAULT CHARSET=utf8 COMMENT='业务表';

