#
# Structure for table "tx_pay_order"
#

CREATE TABLE `tx_pay_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `orderType` varchar(255) DEFAULT NULL COMMENT '订单类型',
  `payNumber` varchar(255) DEFAULT NULL COMMENT '缴费号',
  `orderNumber` varchar(255) DEFAULT NULL COMMENT '订单号',
  `queryNumber` varchar(255) DEFAULT NULL COMMENT '流水号',
  `state` int(11) DEFAULT '0' COMMENT '缴费状态 0 未支付 1 已支付',
  `createTime` datetime DEFAULT NULL COMMENT '订单时间',
  `fee` bigint(20) DEFAULT '0' COMMENT '缴费金额',
  `realFee` bigint(20) DEFAULT '0' COMMENT '实际缴费金额',
  `userId` int(11) DEFAULT NULL COMMENT '缴费人id',
  `userName` varchar(255) DEFAULT NULL COMMENT '缴费用户姓名',
  `promoterId` int(11) DEFAULT NULL COMMENT '一代id',
  `promoterName` varchar(255) DEFAULT NULL COMMENT '一代名称',
  `twoPromoterId` int(11) DEFAULT NULL COMMENT '二代id',
  `twoPromoterName` varchar(255) DEFAULT NULL COMMENT '二代名称',
  `oneRate` int(11) DEFAULT '0' COMMENT '一代分润',
  `twoRate` int(11) DEFAULT '0' COMMENT '二代分润',
  `devRate` int(11) DEFAULT '0' COMMENT '开发分润',
  `totalRate` int(11) DEFAULT '0' COMMENT '总代分润',
  `accNo` varchar(255) DEFAULT NULL COMMENT '支付银行卡号',
  `payWay` int(11) DEFAULT '1' COMMENT '支付方式 1 微信支付 3 快捷支付 4 银联web支付',
  `settleDate` date DEFAULT NULL COMMENT '清算日期',
  `refundNumber` varchar(255) DEFAULT NULL COMMENT '退费单号',
  `cityCode` varchar(255) DEFAULT NULL COMMENT '城市代码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8 COMMENT='缴费订单';

