#
# Structure for table "tx_wx_user"
#

CREATE TABLE `tx_wx_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nick_name` varchar(255) DEFAULT NULL COMMENT '昵称',
  `openId` varchar(50) DEFAULT NULL,
  `head_url` varchar(500) DEFAULT NULL COMMENT '头像地址',
  `sex` int(11) DEFAULT NULL COMMENT '性别 1 男 2 女',
  `create_time` datetime DEFAULT NULL COMMENT '注册时间',
  `real_name` varchar(255) DEFAULT NULL COMMENT '真实姓名',
  `ID_number` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `card_number` varchar(255) DEFAULT NULL COMMENT '结算卡号',
  `ID_url` varchar(500) DEFAULT NULL COMMENT '身份证正面照地址',
  `ID_fan_url` varchar(500) DEFAULT NULL COMMENT '身份证反面照地址',
  `ID_person_url` varchar(500) DEFAULT NULL COMMENT '手持身份证照片地址',
  `card_url` varchar(500) DEFAULT NULL COMMENT '银行卡正面照地址',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机',
  `state` int(11) DEFAULT '0' COMMENT '状态 0 未审核 1 审核通过',
  `open_bank` varchar(255) DEFAULT NULL COMMENT '开户行行号',
  `promoter_id` int(11) DEFAULT NULL COMMENT '推广员id',
  `mer_id` varchar(255) DEFAULT NULL COMMENT '分配的商户号',
  `check_state` int(11) DEFAULT '0' COMMENT '易付通接口验证状态0未通过 1 通过',
  `msg` varchar(255) DEFAULT NULL COMMENT '接口验证失败原因',
  `two_promoter_id` int(11) DEFAULT NULL COMMENT '二级拓展业务员',
  `password` varchar(255) DEFAULT NULL COMMENT '登录密码',
  `scanTicket` varchar(255) DEFAULT NULL COMMENT '二维码，用户发展下级',
  `qrCodeUrl` varchar(500) DEFAULT NULL COMMENT '二维码地址',
  PRIMARY KEY (`id`),
  UNIQUE KEY `openId` (`openId`),
  UNIQUE KEY `mobile` (`mobile`),
  KEY `promoter_id` (`promoter_id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 COMMENT='用户表（购买商品用户）';

