#
# Structure for table "tx_wx_user_bankno"
#

CREATE TABLE `tx_wx_user_bankno` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `wx_user_id` int(11) DEFAULT NULL COMMENT '微信用户id',
  `acc_no` varchar(255) DEFAULT NULL COMMENT '银行卡号',
  `token` varchar(255) DEFAULT NULL,
  `acc_name` varchar(255) DEFAULT NULL COMMENT '发卡行',
  `end_code` varchar(255) DEFAULT NULL COMMENT '银行卡后四位',
  `phone` varchar(255) DEFAULT NULL COMMENT '银行预留手机号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `acc_no` (`acc_no`),
  KEY `wx_user_id` (`wx_user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=utf8 COMMENT='用户银行卡号关联表';

